(787, ' ISTE STATE LEVEL CONVENTION ', 'Dear Students,\n\nThis year our institute is bestowed with the honor of conducting “ISTE Students State Level Convention 2013” on 21st September, 2013 by the Executive Council, ISTE, New Delhi. Various ISTE awards will be presented in the Convention to the students for their performance during the year. Paper / Poster / Project Presentation /Robotics and Lan Gaming activities will be conducted during the convention.\n\nI m sending you details of the same just for your knowledge and information.\n\nDETAILS OF EVENTS ISTE STATE LEVEL CONVENTION 2013\nPATRONS\n\nDr. R. Murugesan\nPresident, ISTE\nDr. Vasani Rupesh P.\nChairman, ISTE Gujarat Section\nShree Pravinbhai Maniar\nChairman, V. V. P. E. C.\nDr. Sachin Parikh\nPrincipal, V. V. P. E. C.\n\nADVISORY BOARD\nProf. P. K .Desai, Vice President, ISTE\nDr. S. Basil Gnanappa, Executive Secretary, ISTE\nProf. Indrajit Patel, Executive Council Member, ISTE\nShree Chandrakantbhai Pavagadhi, Managing Trustee, V. V. P. E. C.\nShree Lalitbhai Mehta, Trustee, V. V. P. E. C.\nShree Kaushikbhai Shukla, Trustee, V. V. P. E. C.\n\nORGANIZING COMMITTEE\nORGANIZING CONVENERS\nMs. Raja Pooja A.\nFaculty Advisor, ISTE Student Chapter\nDr. Chirag Vibhakar\nH. O. D, Electrical Engg Department\nMs. Shilpa Kathad,\nFaculty Advisor, ISTE Staff Chapter\n\nPROGRAMME MEMBERS\n\nMs. Devangi Kotak\nAssistant Professor, C. E. Dept.\nMs. Darshana H. Patel\nAssistant Professor, I. T. Dept.\nMr. Jignesh Ajmera\nAssistant Professor, E. C. Dept.\nDr. Krishna Joshi\nAssistant Professor, B. T. Dept.\n \nMr. K. V. Nagecha\nAssistant Prof. & HOD, Civil Dept.\nDr. O. K. Mahadwad\nAssistant Prof. & HOD, Chemical Dept.\nMs. Megha Kariya\nAssistant Professor, Mechanical Dept.\n\nDATE OF EVENT: 21st September, 2013.\nEVENTS:      1) Paper Presentation\n                        2) Poster Presentation\n                        3) Project Presentation\n                        4) Robotics\n                        5) Lan Gaming\n \n \n \nFEES:\n·         Rs. 250 /- per person for maximum 3 Events (Paper, Poster, Project) – For ISTE Members.\n·         Rs. 350/- per person for maximum 3 Events (Paper, Poster, Project) – For Non - ISTE Members.\n·         Rs. 100/- per person for Robotics – For ISTE / Non-ISTE Members both.\n·         On the spot Registration for Lan Gaming.\n \nSUBMISSION:\nPaper: Full Length\nPoster / Project: Abstract\n \nDEADLINES:\n17th August - 2013 Submission of paper, poster and project details only for VVPians\n31st August – 2013: Submission of paper, poster and project details as mentioned above.\n5th September – 2013: Declaration of Final Acceptance on Website / Through Email.\n10th September – 2013: Registration / Payment of Fees\n \nPROCEDURE FOR REGISTRATION:\nStep – 1: Submit your paper / poster / project details on  iste2013@vvpedulink.ac.in(Please mention your branch with your name) before 31st August 2013.\nStep – 2: After confirmation of acceptance, on 5th September, Download Registration Form \nStep – 3: Draw a D. D. of the name “V. V. P. Project Co-ordinator”, payable at “Rajkot”. (Please write down your name at the back side of D. D. with title of your paper/poster/project)\nStep – 4: Post both Registration form as well as D. D. to our address, VVP Engineering College, Virda Vajadi, Kalawad Road, Rajkot, Gujarat-360005\n\nFOR FURTHER QUERIES:\nContact:\nStudent Co-ordinators:\n1)      Mangukiya Ajay                               2) Goswami Darshit\nM: 89800 89853                                 M: 90169 90875\n\nThanking you,\n\nPooja Raja\nFaculty', '2013-09-21 04:00:00', '2013-09-21 04:00:00', 31, '2phv51meb9g8rg4art4bmoppcg'),
